async function joinGame(){var e=$(this).attr("value");console.log(e);e=JSON.parse(e),e=await fetch("/api/games/join",{method:"POST",body:JSON.stringify({game_id:e}),headers:{"Content-Type":"application/json"}});e.ok?(alert("Game joined successfully"),document.location.replace("/game/setup")):alert(e.message)}$(document).on("click",".join-game",joinGame);